	@Inject
	public SitemapGrammarAccess(GrammarProvider grammarProvider,
			TerminalsGrammarAccess gaTerminals) {
		this.grammar = internalFindGrammar(grammarProvider);
		this.gaTerminals = gaTerminals;
		this.pSitemapModel = new SitemapModelElements();
		this.pSitemap = new SitemapElements();
		this.pWidget = new WidgetElements();
		this.pNonLinkableWidget = new NonLinkableWidgetElements();
		this.pLinkableWidget = new LinkableWidgetElements();
		this.pFrame = new FrameElements();
		this.pText = new TextElements();
		this.pGroup = new GroupElements();
		this.pImage = new ImageElements();
		this.pVideo = new VideoElements();
		this.pChart = new ChartElements();
		this.pWebview = new WebviewElements();
		this.pSwitch = new SwitchElements();
		this.pMapview = new MapviewElements();
		this.pSlider = new SliderElements();
		this.pSelection = new SelectionElements();
		this.pList = new ListElements();
		this.pSetpoint = new SetpointElements();
		this.pColorpicker = new ColorpickerElements();
		this.pDefault = new DefaultElements();
		this.pMapping = new MappingElements();
		this.pVisibilityRule = new VisibilityRuleElements();
		this.pItemRef = new ItemRefElements();
		this.pGroupItemRef = new GroupItemRefElements();
		this.pIcon = new IconElements();
		this.pColorArray = new ColorArrayElements();
		this.pCommand = new CommandElements();
		this.pNumber = new NumberElements();
		this.pXState = new XStateElements();
		this.tID = (TerminalRule) GrammarUtil.findRuleForName(getGrammar(), "org.openhab.core.model.sitemap.Sitemap.ID");
		this.tFLOAT = (TerminalRule) GrammarUtil.findRuleForName(getGrammar(), "org.openhab.core.model.sitemap.Sitemap.FLOAT");
		this.pBOOLEAN_OBJECT = new BOOLEAN_OBJECTElements();
	}
	
	protected Grammar internalFindGrammar(GrammarProvider grammarProvider) {
		Grammar grammar = grammarProvider.getGrammar(this);
		while (grammar != null) {
			if ("org.openhab.core.model.sitemap.Sitemap".equals(grammar.getName())) {
				return grammar;
			}
			List<Grammar> grammars = grammar.getUsedGrammars();
			if (!grammars.isEmpty()) {
				grammar = grammars.iterator().next();
			} else {
				return null;
			}
		}
		return grammar;
	}
	
	@Override
	public Grammar getGrammar() {
		return grammar;
	}
	
	
